#include <iostream>#include <time.h>#include <string>#include <sstream>#include <vector>#include "Map.hpp"using namespace std;//==================================================int main () {        // 1.Initialize an empty Skip_list object    cs540::Map<int, string> s;        // 2. insert()    for (int i = 1; i < 11; ++i){                stringstream ss;        ss << i;        s.insert(make_pair(i, ss.str()));    }    cout <<"Press any key to see the next test\n";    auto it1 = s.begin();    auto it2 = s.end();    cin.get();    s.print();    cout <<"ORIGINAL CONTENTS IN A 12x32 VIEWING FIELD\n";    cin.get();    cout <<"INSERT TEST\n";    cout << "SIZE PRE INSERT 11: " << s.size() << endl;    cin.get();    s.insert(make_pair(11, "TEST"));    s.print();    cout << "SIZE POST INSERT 11: " << s.size() << endl;    cin.get();    cout <<"INSERT TEST FOR SAME KEY\n";    cin.get();    s.insert(make_pair(11, "NOT TEST"));    cout << "SIZE POST INSERT 11: " << s.size() << endl;    cin.get();    cout <<"ERASE TEST 11: SIZE PRE: " << s.size() << endl;    cin.get();    s.erase(11);    s.print();    cout << "SIZE POST ERASE: " << s.size();    cin.get();        cout <<"ITERATOR TEST, POINTING AT FIRST AND LAST VARIABLE BEFORE 11 INSERT\n";    cout << "it1: ";    it1.print();    cout << "it2: ";    it2.print();    cout << "it1++\n";    cin.get();    cout << "it1: ";    it1++;    it1.print();    cout << "EQUALITY CHECK\n";    cin.get();    if (it1==it1)    {        cout << "it1==it1 Equal Works\n";    }    if (it1!=it2)    {        cout << "it1!=it2 NonEqualWorks\n";    }    cout << "ITERATE it2 WITH -- until it reaches it1\n";    cin.get();    while (it2!=it1)    {        it2--;        cout << "it2: ";        it2.print();    }    cout <<"REACHED AT it1: ";    it1.print();    cout << endl;    cout << "SEARCHING FOR KEY 2 FOR it3\n";    cin.get();    auto it3 = s.find(2);    cout <<"it3: ";    it3.print();    cout <<"COMPARING it3 AND it2\n";    cin.get();    if (it3 == it2)    {        cout <<"it2: ";        it2.print();        cout <<"it3: ";        it3.print();        cout <<"THEY ARE EQUAL\n";    }        cout << "\nDone!\n";  }